import Foundation
import SwiftUI

struct OpenSong: View {
    
    let songs: [Song] = [
        Song(
            id: 1,
            spotifyId: "72gv4zhNvRVdQA0eOenCal?si=96e5072fefbc4443",
            name: "Symphony (feat. Zara Larsson)",
            artistName: "Clean Bandit, Zara Larsson",
            albumArtURL: "data:image/jpeg;base64,"
        ),
        Song(
            id: 2,
            spotifyId: "28qA8y1sz0FTuSapsCxNOG?si=234bd9571cef4461",
            name: "Father Time",
            artistName: "Kendrick Lamar, Sampha",
            albumArtURL: "data:image/jpeg;base64,"
        ),
        Song(
            id: 3,
            spotifyId: "124NFj84ppZ5pAxTuVQYCQ?si=714d11c4f14946f6",
            name: "Take Care",
            artistName: "Drake, Rihanna",
            albumArtURL: "data:image/jpeg;base64,"
        ),
        Song(
            id: 4,
            spotifyId: "5vNRhkKd0yEAg8suGBpjeY?si=369bc044c6a74f2a",
            name: "APT.",
            artistName: "ROSÉ, Bruno Mars",
            albumArtURL: "data:image/jpeg;base64,"
        ),
        Song(
            id: 5,
            spotifyId: "754hhnczVNu3ibRaoAcujX?si=80e95c08bb7b4fc1",
            name: "killstreaks (with Don Toliver & PinkPantheress) also a long title test",
            artistName: "Baby Keem",
            albumArtURL: "data:image/jpeg;base64,"
        ),
    ]
    
    var body: some View {
        GeometryReader {geometry in
            VStack(alignment: .leading, spacing: 20) {
                Spacer()
                VStack (alignment: .leading){
                    Text("Your nostalgia")
                        .font(.custom("IvyOraDisplay-Regular", size: 48))
                        .foregroundColor(.white)
                    Text("sounds")
                        .font(.custom("Syne-Bold", size: 40))
                        .foregroundColor(.white)
                }
                ScrollView {
                    VStack {
                        ForEach(songs, id: \.id) { song in
                            HStack (spacing: 15) {
                                if let url = URL(string: song.albumArtURL) {
                                    AsyncImage(url: url) { phase in
                                        switch phase {
                                        case .empty:
                                            ProgressView()
                                                .frame(width: 80, height: 80)
                                                .cornerRadius(10)
                                        case .success(let image):
                                            image
                                                .resizable()
                                                .aspectRatio(contentMode: .fill)
                                                .frame(width: 80, height: 80)
                                                .cornerRadius(10)
                                                .clipped()
                                        case .failure:
                                            Image(systemName: "photo")
                                                .resizable()
                                                .aspectRatio(contentMode: .fit)
                                                .frame(width: 80, height: 80)
                                                .cornerRadius(10)
                                        @unknown default:
                                            EmptyView()
                                        }
                                    }
                                }
                                VStack(alignment: .leading) {
                                    Text(song.name)
                                        .font(.custom("Syne-Bold", size: 22))
                                        .foregroundColor(.white)
                                        .bold()
                                        .multilineTextAlignment(.leading)
                                    Text(song.artistName)
                                        .font(.custom("Syne-Regular", size: 18))
                                        .foregroundColor(.white)
                                        .multilineTextAlignment(.leading)
                                }
                            }
                            .frame(maxWidth: .infinity, alignment: .leading)
                            .padding(10)
                            .background(Color.gray.opacity(0.7))
                            .cornerRadius(10)
                        }
                    }
                }
                Button(action: {
                }) {
                    Text("Thank You, Next!")
                        .foregroundColor(.black)
                }
                .padding()
                .frame(maxWidth: .infinity, maxHeight: 60)
                .background(Color.white)
                .cornerRadius(30)
                .padding(.horizontal, 30)
                .padding(.bottom, 5)
                Spacer()
            }
            .padding()
            .frame(maxWidth: .infinity, maxHeight: .infinity)
        }
    }
}

